import './App.css';
import Cover from "./Cover";
import Features from "./Features";
import Portfolio from './Portfolio';
import Footer from "./Footer";
import AboutUs from "./AboutUs";
import Topbar from "./Navbar";

function App() {
  return (
    <div className="App">
      <Topbar />
      <Cover />
      <Features />
      <Portfolio />
      <AboutUs />
      <Footer />

    </div>
  );
}

export default App;
